#define INPUT_SIZE 784  // Size of input vector (28x28 image)
#define OUTPUT_SIZE 10  // Number of classes (digits 0-9)

#define MAX_BUFFER_SIZE 1024


// Sigmoid activation function
double sigmoid(double x) {
    return 1.0 / (1.0 + exp(-x));
}

void forwardPass( double input[INPUT_SIZE],  double weights[INPUT_SIZE][OUTPUT_SIZE], double biases[OUTPUT_SIZE], double output[OUTPUT_SIZE]) {
    	for (int i = 0; i < OUTPUT_SIZE; ++i) {
        	double sum = biases[i];
        	for (int j = 0; j < INPUT_SIZE; ++j) {
            		sum += weights[j][i] * input[j];
        		}
        	output[i] = sigmoid(sum);
    		}
	}

